import React from "react";

const Search = () => (
  <div className="search h-100 py-2">
    <ul className="nav nav-tabs nav-fill" id="searchTab" role="tablist">
      <li className="nav-item">
        <a className="nav-link active" id="search-tab" data-toggle="tab" href="#search" role="tab" aria-controls="search" aria-selected="true">Search</a>
      </li>
      <li className="nav-item">
        <a className="nav-link" id="code-tab" data-toggle="tab" href="#code" role="tab" aria-controls="code" aria-selected="false">Code</a>
      </li>
      <li className="nav-item">
        <a className="nav-link" id="bills-tab" data-toggle="tab" href="#bills" role="tab" aria-controls="bills" aria-selected="false">Bills</a>
      </li>
      <li className="nav-item">
        <a className="nav-link" id="legislators-tab" data-toggle="tab" href="#legislators" role="tab" aria-controls="legislators" aria-selected="false">Legislators</a>
      </li>
    </ul>

    <style jsx>{`
      .search {
        border: 1px solid rgb(222, 226, 230);;
      }
    `}</style>
  </div>
);

export default Search;
